import React from 'react'

function Test() {
    const plantList = [
        'monstera',
        'ficus lyrata',
        'pothos argenté',
        'yucca',
        'palmier'
    ]
    return (
        <ul>
            {plantList.map((plant) => {
            <li>{plant}</li>
            })}
        </ul>
    )
}

export default Test
